import { motion } from "framer-motion";

const languages = ["JavaScript", "TypeScript", "Python", "HTML/CSS", "SQL"];

const About = () => {
  return (
    <section id="about" className="relative py-32 bg-light-bg dark:bg-dark-bg overflow-hidden">
      {/* Background Decoration */}
      <div className="absolute inset-0 pointer-events-none">
        <div className="absolute top-0 right-0 w-96 h-96 bg-gradient-to-bl from-accent-200/20 dark:from-accent-900/10 to-transparent rounded-full blur-3xl" />
      </div>

      <div className="relative z-10 mx-auto max-w-7xl px-8">
        <motion.div
          className="mb-16 text-center"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6 }}
        >
          <h2 className="font-display text-5xl md:text-6xl font-bold mb-4 premium-heading">About Me</h2>
          <p className="text-lg text-gray-600 dark:text-gray-400">Get to know me better</p>
        </motion.div>

        <div className="grid gap-12 lg:grid-cols-2 lg:gap-16">
          <motion.div
            className="space-y-6"
            initial={{ opacity: 0, x: -30 }}
            whileInView={{ opacity: 1, x: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6 }}
          >
            <p className="text-lg leading-relaxed text-gray-700 dark:text-gray-300">
              I'm a passionate <span className="font-semibold text-primary-600 dark:text-primary-400">Software Engineer and UI/UX Designer</span> with a love for creating seamless
              digital experiences. With expertise spanning both front-end development and design, I bridge
              the gap between beautiful interfaces and robust functionality.
            </p>
            <p className="text-lg leading-relaxed text-gray-700 dark:text-gray-300">
              My journey in technology started with a curiosity about how things work, which evolved into
              a career focused on building products that not only work well but also delight users. I believe
              that great design is invisibleâ€”it just works.
            </p>
            <p className="text-lg leading-relaxed text-gray-700 dark:text-gray-300">
              When I'm not coding or designing, you'll find me exploring new technologies, contributing to
              open-source projects, and mentoring aspiring developers.
            </p>
          </motion.div>

          <motion.div
            className="space-y-6"
            initial={{ opacity: 0, x: 30 }}
            whileInView={{ opacity: 1, x: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6, delay: 0.2 }}
          >
            <div className="card-premium">
              <h3 className="font-display text-2xl font-bold mb-5 text-gray-900 dark:text-white">Programming Languages</h3>
              <div className="flex flex-wrap gap-3">
                {languages.map((lang, index) => (
                  <motion.span
                    key={lang}
                    className="rounded-full bg-gradient-to-r from-primary-100 to-accent-100 dark:from-primary-900/40 dark:to-accent-900/40 border border-primary-200 dark:border-primary-800/50 px-5 py-2.5 text-sm font-semibold text-primary-700 dark:text-primary-300"
                    initial={{ opacity: 0, scale: 0.8 }}
                    whileInView={{ opacity: 1, scale: 1 }}
                    viewport={{ once: true }}
                    whileHover={{ scale: 1.05, y: -2 }}
                    transition={{ duration: 0.3, delay: index * 0.1 }}
                  >
                    {lang}
                  </motion.span>
                ))}
              </div>
            </div>

            <div className="card-premium">
              <h3 className="font-display text-2xl font-bold mb-5 text-gray-900 dark:text-white">What I Do</h3>
              <ul className="space-y-4">
                {[
                  "Full-stack web development",
                  "UI/UX design & prototyping",
                  "Responsive web design",
                  "Design systems & component libraries"
                ].map((item, index) => (
                  <motion.li
                    key={index}
                    className="flex items-start gap-3 group"
                    initial={{ opacity: 0, x: -20 }}
                    whileInView={{ opacity: 1, x: 0 }}
                    viewport={{ once: true }}
                    transition={{ duration: 0.4, delay: index * 0.1 }}
                  >
                    <div className="mt-1 flex-shrink-0 w-6 h-6 rounded-lg bg-gradient-to-br from-primary-500 to-accent-500 flex items-center justify-center shadow-md group-hover:shadow-lg transition-shadow">
                      <svg className="h-4 w-4 text-white" fill="currentColor" viewBox="0 0 20 20">
                        <path fillRule="evenodd" d="M16.707 5.293a1 1 0 010 1.414l-8 8a1 1 0 01-1.414 0l-4-4a1 1 0 011.414-1.414L8 12.586l7.293-7.293a1 1 0 011.414 0z" clipRule="evenodd" />
                      </svg>
                    </div>
                    <span className="text-gray-700 dark:text-gray-300 font-medium">{item}</span>
                  </motion.li>
                ))}
              </ul>
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
